         <Card.Body>
         <Container className="text-center" style={{ fontSize: "1.6em" }}>
            <strong>
            <i class="fa-thin fa-envelope" ></i>
            
            benhafsailhem22@gmail.com
            <br></br>
            phone number : 0541 45 83 65
            </strong>
        
            <br></br>
            <Button className='my-3'>
             Download resume 
            </Button>
            </Container>

         </Card.Body>
         </Card>
           
        
        </Container>
        </Container>
        </React.Fragment>
    );
} 
export default Detail;
